import React, { Component } from 'react';
import Bullet from "./Bullet.js";
import yaml from "yaml-js";
import './App.css';

class App extends Component {

  static data = `
    RootNote:
      name: null
      completed: null
      children:
        - name: Note1
          note: null
          completed: false
          children: []
        - name: Note2
          note: Note2 Note
          completed: true
          children:
            - name: Note2a
              note: null
              completed: false
              children: []
            - name: Note2b
              note: null
              completed: false
              children: []
  `;

  constructor(props) {
    super(props);

    this.json = "";
    this.selected = {};
  }

  componentDidMount() {
    this.json = yaml.load(this.data);
  }

  render() {
    return (
      <div className="Page">
        { this.json }
        { }
      </div>
    );
  }
}

export default App;
